import axios from "axios";

export const fetchDashboardData = async() => {
    const res=await axios.get(
        "http://localhost:3001/api/dashboard/stats",
        {
            headers: {
                Authorization: `Bearer ${localStorage.getItem("token")}`,
            },
        }
    );
    return res.data;
};
